import React from "react";
import Lingumi from "../images/Lingumi-Logo.png";
// import { Grid } from "@material-ui/core";

function Main() {
  return (
    <div>
      <h1>Our Voice Technology is Trusted By</h1>
      <div container>
        <img style={{ width: "20%" }} src={Lingumi} alt="Logo" />;
        <img style={{ width: "20%" }} src={Lingumi} alt="Logo" />;
        <img style={{ width: "20%" }} src={Lingumi} alt="Logo" />;
        <img style={{ width: "20%" }} src={Lingumi} alt="Logo" />;
        <img style={{ width: "20%" }} src={Lingumi} alt="Logo" />;
      </div>
    </div>
  );
}

export default Main;
